import React, { useEffect, useState } from 'react';
import './App.css';

const GoogleMapsPage = () => {
  const [mapLoaded, setMapLoaded] = useState(false);
  const [apiKey, setApiKey] = useState('');

  useEffect(() => {
    const script = document.createElement('script');
    var key = 'abcdefg'
    script.src =
      'https://maps.googleapis.com/maps/api/js?key=' + key+ '&callback=initMap&libraries=maps,marker&v=beta';
    script.defer = true;
    script.async = true;

    script.onload = () => {
      setMapLoaded(true);
    };

    script.onerror = () => {
      console.error('Error loading Google Maps API script.');
    };

    document.head.appendChild(script);

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  useEffect(() => {
    if (mapLoaded) {
      initMap();
      // Scroll to the map element after it has loaded
      document.getElementById('map').scrollIntoView({ behavior: 'smooth' });
    }
  }, [mapLoaded]);

  const initMap = () => {
    const map = new window.google.maps.Map(document.getElementById('map'), {
      center: { lat: 37.227653, lng: -80.421832 }, // Virginia Tech Campus
      zoom: 12,
    });

    const marker = new window.google.maps.Marker({
      position: { lat: 37.227653, lng: -80.421832 }, // Virginia Tech Campus
      map: map,
      title: 'Virginia Tech',
    });

    marker.addListener('click', () => {
      console.log('Marker clicked!');
    });
  };

  const handleFileChange = (event) => {
    const fileInput = event.target;

    if (fileInput.files.length > 0) {
      const file = fileInput.files[0];
      const reader = new FileReader();

      reader.onload = function (e) {
        const content = e.target.result;
        setFileContent(content);
      };

      // Read the file as text
      reader.readAsText(file);
    }
  };

  return (
    <section className="App-section">
      <h2>Google Maps Page</h2>
      <input type="file" id="fileInput" onChange={handleFileChange} />
      <div id="map" style={{ width: '800px', height: '800px', margin: '0 auto', marginBottom: '20px' }}></div>

      {fileContent && (
        <div id="input" style={{ margin: '0 auto' }}>

          <h3>File Content:</h3>
          <pre>{fileContent}</pre>
        </div>
      )}

    </section>
  );
};

export default GoogleMapsPage;
